class Carro{
    Integer id;
    String license;
    String driver;
    Integer pasajero;

    @Override
    public String toString() {
        // TODO Auto-generated method stub
        return "\nid: " + id + 
        "\nlicense: " + license + 
        "\ndriver: " + driver + 
        "\npasajero: " + pasajero;
    }
}
